import React from 'react';
import '../styles/styles.css';
import '../styles/Home.css';

const Home = () => {
  return (
    <div className="home-container">
      <h1 className="home-title">Welcome to Happy Wish!</h1>
      <p className="home-description">Book your dream wedding with us!</p>
      
      <section className="process-section">
        <h2 className="process-title">Our Process</h2>
        <div className="process-steps">
          <div className="process-step">
            <img src="path/to/your/image1.jpg" alt="Step 1" className="process-image" />
            <h3>Step 1: Sign Up</h3>
            <p>Create an account to get started.</p>
          </div>
          <div className="process-step">
            <img src="path/to/your/image2.jpg" alt="Step 2" className="process-image" />
            <h3>Step 2: Customize</h3>
            <p>Personalize your experience.</p>
          </div>
          <div className="process-step">
            <img src="path/to/your/image3.jpg" alt="Step 3" className="process-image" />
            <h3>Step 3: Enjoy</h3>
            <p>Start using our application and enjoy the benefits.</p>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
